import React from 'react'
import { Typography, Box } from '@mui/material';
import MenuBar from '../Menu/MenuBar';

const DashboardPage = () => {
  return (
     <>
            <MenuBar />
            <Box sx={{ p: 4 }}>
                <Typography variant="h4" align="center">Dashboard Overview</Typography>
            </Box>
        </>
  )
}

export default DashboardPage
